import React from 'react';
import ItemsList from './ItemsList';

class App extends React.Component {
  render() {
    return (
      <div className="page">
        <ItemsList />
      </div>
    );
  }
}

App.defaultProps = {
  description: 'No hay descripción.'
};

export default App;
